insert into introducer_commissions (introducer_id, deal_id, investor_id, basis_type, rate_bps, accrual_amount, currency, status, introduction_id, threshold_multiplier, performance_threshold_type)
select v.introducer_id, v.deal_id, v.investor_id, v.basis_type, v.rate_bps, v.accrual_amount,
       'USD'::text, 'accrued'::text,
       i.id, v.threshold_multiplier, v.performance_threshold_type
from new_comm v
join introductions i on i.introducer_id=v.introducer_id and i.deal_id=v.deal_id and i.prospect_investor_id=v.investor_id
where not exists (
  select 1 from introducer_commissions ic
  where ic.introducer_id=v.introducer_id and ic.deal_id=v.deal_id and ic.investor_id=v.investor_id
    and ic.basis_type=v.basis_type
    and ic.rate_bps is not distinct from v.rate_bps
    and ic.accrual_amount is not distinct from v.accrual_amount
);

-- VC106 remove exact duplicate commission rows (keep one)
with vc as (
  select ic.*
  from introducer_commissions ic
  join deals d on ic.deal_id=d.id
  join vehicles v on d.vehicle_id=v.id
  where v.entity_code='VC106'
),
marked as (
  select id, row_number() over (
    partition by introducer_id, deal_id, investor_id, basis_type, rate_bps, accrual_amount, currency, status,
                 invoice_id, paid_at, introduction_id, base_amount, approved_by, approved_at, payment_due_date,
                 payment_reference, notes, arranger_id, fee_plan_id, updated_at, rejection_reason, rejected_by,
                 rejected_at, threshold_multiplier, tier_number, performance_threshold_type
    order by id
  ) as rn
  from vc
)
delete from introducer_commissions where id in (select id from marked where rn > 1);